--
-- Name: Ranking_Customer; Type: VIEW; Schema: transformation; Owner: postgres
--

CREATE VIEW transformation."Ranking_Customer" AS
 WITH customers_raw AS (
         SELECT customers.customer_id,
            initcap((customers.gender)::text) AS gender,
            customers.age,
            customers.annual_income,
            customers.spending_score,
            customers.profession,
            customers.family_size
           FROM staging.customers
        ), customers_categorized AS (
         SELECT customers_raw.customer_id,
            customers_raw.gender,
            customers_raw.age,
            customers_raw.annual_income,
            customers_raw.spending_score,
            customers_raw.profession,
            customers_raw.family_size,
                CASE
                    WHEN ((customers_raw.annual_income >= 0) AND (customers_raw.annual_income <= 30000)) THEN 'Low Income'::text
                    WHEN ((customers_raw.annual_income >= 30001) AND (customers_raw.annual_income <= 70000)) THEN 'Medium Income'::text
                    WHEN ((customers_raw.annual_income >= 70001) AND (customers_raw.annual_income <= 9999999)) THEN 'High Income'::text
                    ELSE NULL::text
                END AS income_category
           FROM customers_raw
          WHERE ((customers_raw.age IS NOT NULL) AND (customers_raw.annual_income > 0))
        ), ranked_customers AS (
         SELECT customers_categorized.customer_id,
            customers_categorized.gender,
            customers_categorized.age,
            customers_categorized.annual_income,
            customers_categorized.spending_score,
            customers_categorized.profession,
            customers_categorized.family_size,
            customers_categorized.income_category,
            row_number() OVER (PARTITION BY customers_categorized.gender ORDER BY customers_categorized.annual_income DESC) AS income_rank
           FROM customers_categorized
        )
 SELECT customer_id,
    gender,
    age,
    annual_income,
    spending_score,
    profession,
    family_size,
    income_category
   FROM ranked_customers
  WHERE (income_rank <= 10)
  ORDER BY gender, annual_income DESC;


